Cannes 2025 witnessed the soul of storytelling shine through ✨
Meet Mr. Chang, Fedora’s Wrinkles, and The Wait — three heartfelt films from Erams Entertainment, produced by Eram Faridi, graced the screens of Palais F at the 75th Cannes International Film Festival.

The response? Pure magic. Words of praise, eyes filled with emotion, hearts touched across borders. This is what cinema is meant to do — connect, move, and inspire. 🌍🎬

